window.bookSummaryJSON = "<p><b>And so it has come to this.</b></p> <p>The star cluster is awash with the blood of those whose lives have been spent by two men maneuvering fleets like pieces across a chessboard.</p> <p>Only one man can come out on top: Thatcher or Moll.</p> <p>But when a victor finally emerges, what will it mean? What solace can truly be taken by those left over, those whose very lives have been wrecked by a war of unrivaled carnage?</p> <p>Surely <i>someone</i> will be left to pick up the pieces. Someone with the vision to make all of this mean something.</p> <p>For Thatcher's part, he can only do what he was made to do.</p> <p>Win. At all costs.</p> <p><b><i>Spacers, Part 5 </i></b><b>contains Book Nine</b><b><i>: Dead Ahead</i></b><b> through to the end of Book 10: </b><b><i>Storm Break.</i></b></p>"; 
